import React from "react";

import { Button, Grid } from "@mui/material";

export const Rightnav = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={4}>
        <div style={{ height: 90, width: 90 }}>Add Customer</div>
      </Grid>
    </Grid>
  );
};
